let dist = new Array(10).fill(0)
let vis = new Array(10).fill(false)
let path = new Array(10).fill(-1)
function dijkstra(bA, bB) {
    for (let i = 0; i < 10; i++) {
        dist[i] = Infinity
        vis[i] = false
        path[i] = -1
    }
    dist[bA] = 0
    for (let i = 0; i < 10; i++) {
        let t = -1
        for (let j = 0; j < 10; j++) {
            if (!vis[j] && (t == -1 || dist[j] < dist[t])) t = j
        }
        if (t == bB) {
            break
        }
        vis[t] = true
        for (let k = 0; k < 10; k++) {
            let d = Infinity
            if (roads[t][k] != 0) d = roads[t][k].getLength()
            if (t == k) d = 0
            if (dist[t] + d < dist[k]) {
                dist[k] = dist[t] + d
                path[k] = t
            }
        }
    }
    return dist[bB]
}
// 打印目前的最短路
function printroad(bA, bB) {
    let len = dijkstra(bA, bB)
    let stack = []
    let p = bB
    while (path[p] != -1) {
        stack.push(p)
        p = path[p]
    }
    stack.push(p)
    for (let i = stack.length - 1; i > 0; i--) {
        movequeue.push([stack[i], stack[i - 1], 5])
    }
    // console.log(movequeue[0])
    // movequeue[0]()
    movequeue.push(() => moveto(0, 1, 5))
    console.log("路径的总长度为", len, "米")
    let messages = "路径为"
    while (stack.length > 1) {
        messages += stack.pop()
        messages += "->"
    }
    messages += stack.pop()
    console.log(messages)
}

